import React from "react";
import "../css/Body.css";

import picture1 from "../assets/images/silhouette.jpg";
import picture2 from "../assets/images/hondaRepair.jpg";

const Body = () => {
  return (
    <div className="main">
      <h1>T-T Honda</h1>
      <h2>Repairing San Diego's cars since 2004</h2>
      <p>Call Us</p>
      <a href="tel: 2840050">
        <button>(619)284-0050</button>
      </a>
      <p>Located in City Heights neighborhood</p>
      <p>4030 43rd Street San Diego, CA 92105</p>
      <div className="imageMapImage">
        <img src={picture1} alt="honda repair" />;
        <img src={picture2} alt="car on lift" />
      </div>
    </div>
  );
};

export default Body;
